import React from "react";
import classNames from "classnames";

export const DetailIcon = ({className}) =>{
    const classes = classNames(
        className
    )
    return(
        <svg 
        width="35" 
        height="29" 
        className= {classes}
        viewBox="0 0 35 29" 
        fill="none" 
        xmlns="http://www.w3.org/2000/svg" 
        xmlnsXlink="http://www.w3.org/1999/xlink">
            <rect x="0.307617" y="0.0769196" width="34.6154" height="28.4072" fill="url(#pattern0)"/>
            <defs>
            <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
            <use xlinkHref="#image0_79_283" transform="scale(0.00108696 0.0013245)"/>
            </pattern>
            <image id="image0_79_283" width="920" height="755" xlinkHref="data:image/png;base64,"/>
            </defs>
        </svg>
    )
}